import React, {FC} from "react";
import {AccordionComponent} from "./accordion_component/AccordionComponent";
import {IdNameType} from "@root/interfaces/Announcement";


type AncmntAutoFormProps = {
    autoData: {
        automobile: {
            icon: string,
            manufacturer: IdNameType[],
            models: IdNameType[],
            body: IdNameType[],
            transmission: IdNameType[],
            drive: IdNameType[],
        }
    }
};

const form = (data) => {
    return Object.keys(data).map((key, i) => {
        return <AccordionComponent
            key={i}
            icon={data[key].icon}
            title={key}
        />
    })
};

export const AncmntAutoForm: FC<AncmntAutoFormProps> = (props) => {
    const {autoData} = props;

    return (
        <div>
            {form(autoData)}
        </div>
    )
};
